import React from "react";
import Input from "./UI/Input";

const FilterUsers = ({ filter, setFilter }) => {
  return (
    <Input
      value={filter.search}
      onChange={(e) => setFilter({ ...filter, search: e.target.value })}
      placeholder={"Search"}
      type="text"
    />
  );
};

export default FilterUsers;
